
from Crypto.Util.number import *
def RSA_dp(e, n, c, dp):
    for i in range(1, e):
        if (e * dp - 1) % i == 0:
            p = (e * dp - 1) // i + 1
            if n % p == 0:
                q = n // p
                phin = (p - 1) * (q - 1)
                d = inverse(e, phin)
                print(long_to_bytes(pow(c, d, n)))
                break

